import React from 'react';
import '../styles/Services.css';

const Services = () => {
  const services = [
    {
      title: "UI/UX Design",
      description: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Consequuntur rem, operiam alias quis sequi architecto."
    },
    {
      title: "Graphic Design",
      description: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Consequuntur rem, operiam alias quis sequi architecto."
    },
    {
      title: "SEO",
      description: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Consequuntur rem, operiam alias quis sequi architecto."
    },
    {
      title: "Video Editing",
      description: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Consequuntur rem, operiam alias quis sequi architecto."
    },
    {
      title: "Photography",
      description: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Consequuntur rem, operiam alias quis sequi architecto."
    }
  ];

  return (
    <section id="services" className="section">
      <h2>My Services</h2>
      <div className="services-grid">
        {services.map((service, index) => (
          <div key={index} className="service-card">
            <h3>{service.title}</h3>
            <p>{service.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Services;
